【商品説明】<br>●子供のころからのオーラルケアが健康な歯を保つことにつながります。br●天然のコーティング成分セラックと殺菌成分CPCが歯の表面をWでコーティングするので、クチュクチュするだけでカンタンにむし歯を予防できます。br●しっかりと効きめが行き渡る。br●歯ブラシでは届きにくい歯のすき間まで、しっかりと効果が行き渡るので、お子様が歯みがきを嫌がるとき、歯みがきができないとき、また、みがき残しが気になるときにおすすめです。br●お子様が自分でクチュクチュして吐き出せるようになったら（5歳頃）はじめ<br><br>商品サイズ：76×162×45<br><br>効能・効果：むし歯の予防。口中を浄化する。口中を爽快にする。口臭の防止。<br><br>成分：【有効成分】塩化セチルピリジニウム 【その他成分】 ・湿潤剤：濃グリセリン ・溶剤：ＰＧ ・矯味剤：トレハロース、キシリット、スクラロース、グリチルリチン酸2Ｋ ・ＰＨ調整剤：炭酸水素Ｎａ、水酸化Ｎａ ・可溶剤：ＰＯＥセチルエーテル ・歯のコーティング剤：白色セラック ・保存剤：フェノキシエタノール、パラベン ・香料（ぶどうタイプ） ・洗浄剤：ＥＤＴＡ-2Ｎａ ・赤色227号、青色1号<br><br>ご使用上の注意等：●内服液ではありませんので、飲まないでください。br●口中の異常、発疹、かゆみ等の症状が現れた場合は使用を中止し、医師に相談してください。<br><br>●直射日光を避けて保管してください。<br><br>原産国：日本<br><br>問い合わせ先：アース製薬株式会社 〒101-0048 東京都千代田区神田司町2-12-1 （お客様窓口)TEL0120-81-6456<br>区分：医薬部外品<br>JANコード：4901080510518<br><br><br><br>広告文責：アットライフ株式会社<br>TEL 079-280-2113<br>※商品パッケージは変更の場合あり。<br>メーカー欠品または完売の際、キャンセルをお願いすることがあります。ご了承ください。<style>
